import React from 'react';

const Hero = () => {
  return (
    <section>
      <h2>Welcome to my portfolio!</h2>
      <p>I'm a software developer specializing in blockchain technology. I have experience in developing smart contracts, dApps, and blockchain-based solutions.</p>
    </section>
  );
};

export default Hero;
